  loadStandardValidationsFromXML = function(){
								$.ajax({
									type	: "GET",
									url		: "/iContract/GenericEnum/ajax/getCustomTermPeriodUOM",
									contentType: "application/json",
									async   : false,
									cache: false,
									success : function(data) {
										if( data!= null ){
											for(var i=0;i<data.length;i++){
												if(data[i].isCustom === "1"){
													customTimePeriod.push(data[i])
												}
											}
										}	
									},
									error : function(err){
									}
								});
								/* 	Flexi Code */	
								if(flexi_isContractModuleRepository == "true"){
									contractTermPeriod = $("#Contract_Term_Period_UoM :selected").text();
								}

								var isDisableAllControls="${CONTRACT_PROFILE_EDIT_CONTRACT_META_DATA_Value}";

								generateSubEntityGrids();
								/* Flexi code */
								var currentFolderId = jQuery("#Folder").val();
								$.when(changeFolder()).then(function(){
									jQuery("#Folder").val(currentFolderId).trigger("change");
								});
								changedData=false;

								/* Flexi Code */
								setConfiguration(flexi_numberFormat);

								$("input[type='text']").on('keydown',function(e){
									if(e.keyCode == 27){
										$(this).blur();
									}
								});

								validObj = initValidation();



								$(".customSelect").select2();

								/*Added this line to trigger contract term on page load to calculate Expiry date*/
								//Commented by Nitin for CLM-8197 to solve NA uncheck issue
								//$("#Contract_Term").trigger("blur");

								//Added by Nitin on 15th Dec 2017 for CLM 3101
								$(".customSelectWithNonStandardValue").select2({
									  language: {
											noResults: function (params) {
												var select = $(".select2-search__field").parents(".select2-container--open").attr("data-shownonstandardvalue");
												if(select.trim().toUpperCase() === "TRUE"){
													  return "<p id='showStandardValue' onclick='addNoResultClick()'><span>"+$(".select2-search__field").val()+ "</span> ( <span>New</span> ) </p>";
												}else{
													  return "No results found";
												}
											}

									  },
									  tags: true,
									  tokenSeparators: ['`~!'],
									  createTag: function (tag) {
										  return {
											  id: tag.term,
											  text: tag.term+" (New)",
											  // add indicator:
											  isNew : true
										  };
									  },
									  escapeMarkup: function (markup) {
										  return markup;
									  }
								});

								$(".customSelect").on("select2:open", function (e) {
									$(e.currentTarget).addClass('edited'); 
								});

								$(".customSelect").on("select2:select", function (e) {
									if(e.params.data.isNew){
										var str = e.params.data.text;
										str = str.slice( 0, str.lastIndexOf( "(New)" ) );
										e.params.data.text = str.trim();
										 // append the new option element prenamently:
										 //Added by Richa for CLM 4377
										isNewRecord.push(e.params.data.text)
										$(this).find('[value="'+e.params.data.id+'"]').replaceWith('<option isNew="true" selected value="'+e.params.data.id+'">'+e.params.data.text+'</option>');
										//$(this).select2().val(e.params.data.id).trigger("change");
										$(this).val(e.params.data.id).trigger('change');
										//Added by Richa for CLM 4377
										$(this).closest(".group").addClass("customValueAdded");
										$(this).next(".select2-container").find(".select2-selection__rendered").addClass("customValueClass").attr("title",e.params.data.text+"(New)");
										$(".customValueClass").css("cssText", "color: orange !important;");	    
									}
									//Added by Richa for CLM 4377
									else{

										var isNew = $(this).find('[value="'+e.params.data.id+'"]').attr("isNew");
										if(isNew !== undefined && isNew){
											$(this).closest(".group").addClass("customValueAdded");
											$(this).next(".select2-container").find(".select2-selection__rendered").addClass("customValueClass").attr("title",e.params.data.text+"(New)");
											$(".customValueClass").css("cssText", "color: orange !important;");

										}else{
											$(this).closest(".group").removeClass("customValueAdded");
											$(this).next(".select2-container").find(".select2-selection__rendered").removeClass("customValueClass");
											$(this).next(".select2-container").find(".select2-selection__rendered").css("cssText", "color: #333 !important;");
										}

									}

									if($(e.currentTarget).val().length<=0){
										$(e.currentTarget).removeClass('edited');
									}else{
										$(e.currentTarget).addClass('edited');
									} 		
								});

								$(".customSelect").on("select2:close", function (e) {
									if($(e.currentTarget).val().length<=0){
										$(e.currentTarget).removeClass('edited');
									}
								});

								$(document).on("click", function(){
									$(".inputMaterial:not(.customSelect, .radioOptions)").each(function(){
										var ths = $(this);
										((ths.val().length>0) ? ths.addClass("edited") : ths.removeClass("edited"));
									});

									//Added by Richa for flexi
									$(".flexiSelect").each(function(){
										var ths = $(this);
										(($("#"+ths.context.id).siblings(".select2-container").find("#select2-"+ths.context.id+"-container").text() != "") ? ths.addClass("edited") : ths.removeClass("edited"));
										 $("#"+ths.context.id+" > option").each(function() {
												if(this.text == $("#"+ths.context.id).siblings(".select2-container").find("#select2-"+ths.context.id+"-container").text()){
													//Modified for CLM-6934
													$("#"+ths.context.id).val(this.value).trigger("change")
												}
											});
									});

									var currentSelect = $('.select2-container--open').prev('select');
									var helpTxt = currentSelect.attr('help-data');
									if(currentSelect.length > 0 && api != null){
										helpQtip();
										api.set('content.text', helpTxt);
										api.toggle(true);
									}
								});
								$(document).on("ready keydown keyup", function(){
									$(".inputMaterial:not(.radioOptions)").each(function(){
										var ths = $(this);
										((ths.val().length>0) ? ths.addClass("edited") : ths.removeClass("edited"));
									}); 
									$(".flexiSelect").each(function(){
										var ths = $(this);
										(($("#"+ths.context.id).siblings(".select2-container").find("#select2-"+ths.context.id+"-container").text() != "") ? ths.addClass("edited") : ths.removeClass("edited"));
									});
									var currentSelect = $('.select2-container--focus').prev('select');
									currentSelect.addClass('edited');
									var helpTxt = currentSelect.attr('help-data');
									if(currentSelect.length > 0 && api != null){
										helpQtip();
										api.set('content.text', helpTxt);
										api.toggle(true);
									}
								});

								$(".inputMaterial").each(function(){
									var ths = $(this);
									((ths.val().length>0) ? ths.addClass("edited") : ths.removeClass("edited"));
								});	



								$('.formTitle').off("click").on("click", function() {
									var $this = $(this);
									var $sibEle = $this.siblings('.formTableExternal');				
									if ( !$sibEle.is(':visible') ){
										$this.addClass('detailFormOpen').children('.collExpBtn').toggleClass('newCollapse newExpand');
										$sibEle.slideDown(200);
									}
									else{
										$this.removeClass('detailFormOpen').children('.collExpBtn').toggleClass('newCollapse newExpand');
										$sibEle.slideUp(200);
									}
								});

								$(window).scroll(function(){
									if ($(this).scrollTop() > 250) {
										$('#scrollup').fadeIn(300);
									} else {
										$('#scrollup').fadeOut(300);
									}
								});

								//On click scroll to top of page t = 400ms
								$('#scrollup').click(function(){
									$("html, body").animate({ scrollTop: 0 }, 400);
									return false;
								});

								$('.radioOptions input').on("focus", function(){
									$(this).parent().addClass('edited');
								});

								$('.radioOptions input').on("blur", function(){
									$(this).parent().removeClass('edited');
								});    

								$('.customSelect').on("change", function () {
									/* Flexi Code */
									if (!$.isEmptyObject(validObj.submitted)) {
										fromSelect2=true;
										if(_isrequest){
											var selectedText = $(this).find("option:selected").text();
											if(selectedText.trim() != ""){
												$(this).parent().siblings(".error").hide();
											}else{
												$(this).parent().siblings(".error").show();
											}
										}else{
											validObj.form();
										}
									}
								});

								$('.icon.calendar').click(function(){
									$(this).siblings('input').datepicker('show');
								});

								$('.datepickerInput').datepicker({
									changeMonth:true, 
									changeYear:true,
									dateFormat:dateformat,
									onSelect: function(dateText){
										//Added for CLM-6934
										if (typeof removeAIFieldMarker  !== "undefined") { 
											removeAIFieldMarker($(this).attr("id"));
										}
										$(this).focus();
										$(this).addClass("edited");
										if($(this).attr('id') == "Contract_Effective_Date")
										{

											var contractEffectiveDateValue = jQuery("#Contract_Effective_Date").val();
											if(contractEffectiveDateValue){
												var dateInWords = moment(contractEffectiveDateValue, flexi_userDateFormat.toUpperCase()).format("MMMM DD, YYYY");

												if(dateInWords){
													$("#Effective_Date_words").val(dateInWords).addClass("edited");;
												}
											}

											if( $('#term_clause_ppe').length > 0 ){
												$('#term_clause_ppe').text('from '+$('#Contract_Effective_Date').val());
											}

											if(/* jQuery("#Contract_Expiration_Date").val().length == 0 && */ jQuery("#Contract_Expiration_Date").hasClass("disable") == false) 
											{
												calculateExpiryDateAccordingToTerm(dateText);
											}
										} else if($(this).attr('id') == "Contract_Expiration_Date") {
											//Modified for CLM-6934
											jQuery("#Contract_Expiration_Date").val(dateText).trigger("change");
											if(jQuery("#Contract_Expiration_Date").val().length != 0 && jQuery("#Contract_Expiration_Date").hasClass("disable") == false && $("#Contract_Term").val() != undefined) {
												expiryDateCheck(dateText);
											}
											else if (jQuery("#Contract_Expiration_Date").val().length == 0 && jQuery("#Contract_Expiration_Date").hasClass("disable") == false && $("#Contract_Term").val() == undefined){
												expiryDateCheck(dateText);
											} 
										} else if($(this).attr('id') == "CNDA_Date") {
											jQuery("#CNDA_Date").val(dateText).trigger("change");
										} else if($(this).attr('id') == "RSNDA_Date") {
											jQuery("#RSNDA_Date").val(dateText).trigger("change");
										} else if($(this).attr('id') == "RUNDA_Date") {
											jQuery("#RUNDA_Date").val(dateText).trigger("change");
										}
									},
									onChangeMonthYear: function(){
										$(this).addClass("edited");
									}
								});

								jQuery("#Contract_Header_li").addClass("zys-default-tab-active");
								jQuery("#Contract_Header").show();

								fileTypeFieldNames();

								if(authoringFieldsObj != null && authoringFieldsObj != '') {

									showAuthoringFields(authoringFieldsObj);
								}
								/* Flexi Code */
								if(flexi_ContractModule_Amendment == flexi_contractModule)
								{
									jQuery('#Contract_Category').prop('disabled',true).attr('onclick','');
									jQuery('#Contract_Title').prop('disabled',true).attr('onclick','');
								}
								/* Flexi Code */
								if(flexi_ContractModule_Repository == flexi_contractModule || flexi_ContractModule_AuthoringToRepository == flexi_contractModule) {
									if(isConfidentialityFeatureInUse == 'false') {
										jQuery("#ConfidentialContract").closest('td').hide();
										jQuery("#SearchableContract").closest('td').hide();
									} else {
										if(ContractIdValue == 'null' && flexi_shouldMetaDataClone == 'false'){
											$($.grep(jQuery("input[name=ConfidentialContract]"), function(e){ return e.value == "No"; })).prop("checked",true);
										}
										showHideConfidentialityFields();
									}

									jQuery("input[name=ConfidentialContract]").change(function() {
										showHideConfidentialityFields();
										changeFolder();
									});

									jQuery("input[name=SearchableContract]").change(function() {
										changeFolder();
									});

									jQuery("#Contract_Category").change(function() {
										changeFolder();
									});

									jQuery("#Contract_Owner").change(function() {
										changeFolder();
									});
								} else {
									jQuery("#saveAsDraftBtn").hide();
									jQuery("#saveAsDraftBtn").click("");
								}

								if(isAutoRenewEnabled == 'false') {
									jQuery("#AUTO_RENEW option:contains('Auto Renew')").remove();
								}
								/* Flexi Code */
								showHideRenewalFields(ContractIdValue);

								jQuery("#AUTO_RENEW").change(function() {
									showHideRenewalFields();
								});

								/* Added by Richa on 23rd November 2017 */
								jQuery("#Contract_Term_Period_UoM").change(function() {
									calculateExpiryDateAccordingToTerm($("#Contract_Effective_Date").val());
									/* Added by Nitin on 24th Nov 2017 for CLM 3103 */
									/* Modified by Nihal for CLM-8581 */
									if(jQuery("#Contract_Expiration_Date").hasClass("disable") && ( $("#Same_as_Contract_Signed_Date :selected").text().toLowerCase() == "decide later" || $("#Same_as_Contract_Signed_Date :selected").text().toLowerCase() == "automatic (esignature date)" )){
										calculateExpiryDateAccordingToTerm(effectiveDate_3103);
										if($("#Same_as_Contract_Signed_Date").length != 0 && !isRepo){
											//Modified for CLM-6934
											jQuery("#Contract_Expiration_Date").val("").trigger("click").trigger("change");
										}
									}
								});

								autoRenewValue = jQuery("#AUTO_RENEW option:contains('Auto Renew')").val();
								showHideAutoRenewOption(isAutoRenewEnabled);

								jQuery(".qq-upload-button input[type='file']").attr('title','Upload');
								/* Flexi Code */
								if(flexi_ContractModule_Repository == flexi_contractModule || flexi_ContractModule_AuthoringToRepository == flexi_contractModule) {

									if(isEditable == false || isDisableAllControls == 'false' ) {
										disableAllControls();
										isDisabled=true;
									} else{
										if(ContractIdValue != 'null' && ContractIdValue != null){
											if(isConfidentialityFeatureInUse == 'true' && (!isContractAdmin && !isloggedInUserContractOwner())) {
												disableConfidentialFields();
											}
										}
									}
									if(isDownloadable == false) {
										disableDownloadableFields();
									}
									/* Flexi Code */
								} else if(flexi_ContractModule_Authoring == flexi_contractModule || flexi_ContractModule_Amendment == flexi_contractModule || flexi_ContractModule_RepositoryToAuthoring == flexi_contractModule) {
									jQuery("#Contract_Owner").prop('disabled',true).attr('onclick','');

									if(isContractEditable == false || flexi_isMetadataPageEditable == 'false' || isDisableAllControls == 'false') {
										disableAllControls();
										isDisabled=true;
									}
								}

								/* Flexi Code */
								if(ContractIdValue != 'null' && ContractIdValue != null){
									$('.genericDetails #Heirarchy_Status').each(function() {
										$(this).data('lastSelected', $(this).find('option:selected'));
									});

									$('.genericDetails #Heirarchy_Status').on("select2:open",function() {
										$(this).data('lastSelected', $(this).find('option:selected'));
									});

									jQuery("#Heirarchy_Status").on("change",function(e){

										if(stopSelectPropagation){
											stopSelectPropagation = false;
											return;
										}
										validateHeirarchy($(this).find('option:selected'),$(this).data('lastSelected'),this);
									});
								}

								$('.inputMaterial, .radioOptions input').on('focus', function(e){
									var helpTxt = $(this).attr('help-data');
									helpQtip();
									api.set('content.text', helpTxt);
									api.toggle(true);
								});
								$(".helpBox").click(function(){
									var helpTxt = flexi_fmt_icontract_generic_msg;
									helpQtip();
									api.set('content.text', helpTxt);
									api.toggle(true);
								});
								radioBtnDisable();

								jQuery("input[fieldType='INTEGER']").keydown(function (e) {
									var key = e.keyCode;
									if (!((key == 9) || (key == 8) || (key == 46) || (key >= 35 && key <= 40) || (key >= 48 && key <= 57) || (key >= 96 && key <= 105))) {
										e.preventDefault();
									}
								});

								$('span[id$="_Delete"]').keyup(function(event){
									if(event.keyCode == 13){
										$(this).click();
									}
								});

								$('span[id$="_Download"]').keyup(function(event){
									if(event.keyCode == 13){
										$(this).click();
									}
								});	

								//Added by Nitin on 23rd Nov 2017 for CLM 3103
								effectiveDate_3103 = jQuery("#Contract_Effective_Date").val();
								expiryDate_3103 = jQuery("#Contract_Expiration_Date").val();
								if($("#Same_as_Contract_Signed_Date").length != 0){
									$expiryDate = jQuery("#Contract_Effective_Date").closest('td').find(".calendar");
									/*commented by Nihal for CLM-8581
									jQuery("#Contract_Effective_Date").addClass("sameContractSignedDateCB");
									jQuery("<span style='display: inline; margin-left: 25px;'>" +
											"<input id='makeInitDate' help-data='Nitin' class='inputMaterial' type='checkbox' onclick='javascript:markInitDateSameAsSignedDate(false);' " + 
											"title=\""+contractSignedOnDateObj.tooltip+"\" name='makeInitDate'><span title='"+contractSignedOnDateObj.text+"'>"+contractSignedOnDateObj.text+"</span></span>").insertAfter($expiryDate);

									$("#makeInitDate").parent().siblings(".bar").css("width","calc(100% - 260px)");
									if(contractSignedOnDateObj && !contractSignedOnDateObj.isEditable){
										jQuery("#makeInitDate").prop("disabled", true);
									}*/
									/*Modified by Nihal for CLM-8581*/
									if($("#Same_as_Contract_Signed_Date").length != 0 && (jQuery("#Same_as_Contract_Signed_Date :selected").text().trim().toLowerCase() == "decide later" || jQuery("#Same_as_Contract_Signed_Date :selected").text().trim().toLowerCase() == "automatic (esignature date)")){
										//Added by Nitin on 19th April 2018 for CLM 5292
										effectiveDate_3103 = getTodaysDate();
										expiryDate_3103 = effectiveDate_3103;

										calculateExpiryDateAccordingToTerm(effectiveDate_3103);
										markInitDateSameAsSignedDate(true);
										if($("#Same_as_Contract_Signed_Date").length != 0 && !isRepo){
											//Modified for CLM-6934
											jQuery("#Contract_Effective_Date").val("").trigger("click").trigger("change");
										}
									}
								}

								/* Added by Nihal for CLM-8581 */
								if(isLinkBetweenEffectiveDateAndSignedDate == "false"){
									$("#Same_as_Contract_Signed_Date").closest("td").hide();
									$("#Same_as_Contract_Signed_Date").removeClass("required").val("");
								}

								$("#Same_as_Contract_Signed_Date").change(function(){
										markInitDateSameAsSignedDate(false);
								});

								if($("#Same_as_Contract_Signed_Date").length != 0 && isRepo){
									$('#Contract_Signed_On_date').on("blur", function(){
										if($("#Same_as_Contract_Signed_Date :selected").text().toLowerCase() == "decide later" || $("#Same_as_Contract_Signed_Date :selected").text().toLowerCase() == "automatic (esignature date)"){
											//Modified for CLM-6934
											jQuery("#Contract_Effective_Date").val($('#Contract_Signed_On_date').val()).trigger("click").trigger("change");
											effectiveDate_3103 = $('#Contract_Signed_On_date').val();

											if(!$("#perpetualContractCheckBx").is(':checked')){
												var undefinedContractTerm = false
												if($("#Contract_Term").val() == undefined){
													undefinedContractTerm = true; 
												}

												if(!undefinedContractTerm){
													if($("#Contract_Term").val().trim() == "" || $("#Contract_Term_Period_UoM :selected").text().trim() == ""){
														//Modified for CLM-6934
														jQuery("#Contract_Expiration_Date").val($('#Contract_Signed_On_date').val()).trigger("click").trigger("change");
													}else{
														$("#Contract_Term").trigger("blur");
													}
												}else{
													//Modified for CLM-6934
													jQuery("#Contract_Expiration_Date").val($('#Contract_Signed_On_date').val()).trigger("click").trigger("change");
												}
											}
										}
									}); 
								}

								/* Flexi Code */
								if(flexi_isContractModuleRequestPortal == 'false') {
									//Dinesh: Hiding bottomButtonDiv as a fix for CLM-556
									$('div#bottomButtonDiv').hide();
								}

								//Added by Richa for CLM 4377	
								$(".customSelectWithNonStandardValue").each(function(){
									var ths = $(this);
									((ths.val().length>0) ? ths.addClass("edited") : ths.removeClass("edited"));

									var ths = $(this);
									if(isDisabled){
										if($(this).find(".customValue").hasClass("customValueOptionClass")){
											ths.next(".select2-container").find(".select2-selection__rendered").addClass("customValueClass");
											ths.closest(".group").removeClass("customValueAdded");
											selectedCustomValueText = $(".customValueClass").text();
											$(".customValueClass").attr("title",selectedCustomValueText+"(New)");
										}
									}
									else{
										if($(this).find(".customValue").hasClass("customValueOptionClass")){
											ths.next(".select2-container").find(".select2-selection__rendered").addClass("customValueClass");
											$(".customValueClass").css("cssText", "color: orange !important;");
											ths.closest(".group").addClass("customValueAdded");
											selectedCustomValueText = $(".customValueClass").text();
											$(".customValueClass").attr("title",selectedCustomValueText+"(New)");
										}
									}

								});


								/* Added by Nimesh on 31/1/18 for CLM 4323 handling & Issue */
								jQuery(".genericDetails input[type='text'],select,textarea, .genericDetails input[type='radio']").not(".gridBottom input,#revisionComment, #userRevisionComment, #subEntityDiv input,#subEntityDiv textarea").on("change", function(){
									changedData=true;
								});

								patternGenerateOnReady();

								$(document).on('click','#Title_Autogenerated', function(){
									checkAutogeneratedTitle();
								}); 

								/*Added By Nihal for CLM-7710 for loading subtype specific categories on ready*/
								filterContractCategories();
							}

							/* Modified by Nimesh for CLM-7373 - Checkbox appending to Contract Title */
							patternGenerateOnReady = function(){
								if(contractRepoStatus === undefined || contractRepoStatus === null || contractRepoStatus == "" || contractRepoStatus == "null"){
									contractStatus = -2;
								}
								 if(typeof isAmendment == 'undefined'){
									 isAmendment = false;
								 }
								 if(!isAmendment && (isRequestPortal || ((isRepo && (contractRepoStatus == -1 || (contractRepoStatus == 8 && isAuthOrRepo == 1) || (contractRepoStatus == 11 && isAuthOrRepo == 1)) ) || ( !isRepo && (contractStatus == 0 || contractStatus == 1 || contractStatus == 12))))){ 
									getAutoSuggestTitlePattern();
									if(autoSuggestPattern){
										if(autoSuggestPattern.autoTitleConfig && $("#Title_Autogenerated").length!=0){
											$("#Title_Autogenerated").parent().appendTo($("#Contract_Title").parent());
											$("#Contract_Title").attr("disabled","disabled").addClass("edited");	
											bindOnChangeforMetafield();//Will bind onchange events for fields present in Pattern
											checkAutogeneratedTitle();//Will Generate Pattern if Auto-generated Check-box is checked
										}
										else{
											$("#Title_Autogenerated").parent(".checkboxOptions").hide()
										}
									}
									else{
										$("#Title_Autogenerated").parent(".checkboxOptions").hide()
									}
								 }
								 else{
