							generateAutoConfigTitle = function(){
								/* Get Default Values of Metafields according to Pattern and Append to Contract title */
								var response = autoSuggestPattern.autoTitleConfig;
								var pattern =  response.pattern;
								var fieldList = response.fieldList.split(",");
								var seprator = response.fieldSeparator;
								$.each(fieldList, function(index,field){
									//Check for Contracting Party data from the CP Object & replace it if present else Remove it from the pattern
									if(field.toUpperCase()=="CONTRACTING_PARTY"){
										if(CpList.length > 0)
											pattern = pattern.replace('<'+field+'>',CpList);
										else{
											//If field Value is not present then check if pattern ends with that field then replace with previous seprator, else replace with next Seprator
											pattern = replacePatternWithBlank(pattern,'<'+field+'>',seprator);
										}
									}
									//Check for BU data from the ATL by passing the index & replace it if present in the ATL else Remove it from the pattern
									else if(field.toUpperCase()=="BUSINESS_UNITS"){
										var buNameColumnIndex = $("th[abbr='Business_Units']").index();
										if(buNameColumnIndex >= 0)
											var buList = getBU(buNameColumnIndex);
										if(buList)
											buList = buList.trim();
										if(buList!="")
											pattern = pattern.replace('<'+field+'>',buList);
										else{
											pattern = replacePatternWithBlank(pattern,'<'+field+'>',seprator);
										}
									}
									//Check for Type data from the Object & replace it if present else Remove it from the pattern
									else if(field.toUpperCase()=="TYPE"){
										if(typeDisplayName)
											pattern = pattern.replace('<'+field+'>',typeDisplayName);
										else{
											pattern = replacePatternWithBlank(pattern,'<'+field+'>',seprator);
										}
									}
									//Check for Subtype data from the Object & replace it if present else Remove it from the pattern
									else if(field.toUpperCase()=="SUB_TYPE"){
										if(subtypeDisplayName)
											pattern = pattern.replace('<'+field+'>',subtypeDisplayName);
										else{
											pattern = replacePatternWithBlank(pattern,'<'+field+'>',seprator);
										}
									}
									//Check for ATL BU field & Get BU Code by passing Column index of BU CODE in the ATL Grid
									else if(field.toUpperCase()=="CODE"){
										var buCodeColumnIndex = $("th[abbr='Code']").index();
										if(buCodeColumnIndex)
											var buCode = getBU(buCodeColumnIndex);
										if(buCode)
											buCode = buCode.trim();
										if(buCode!="")
											pattern = pattern.replace('<'+field+'>',buCode);
										else{
											pattern = replacePatternWithBlank(pattern,'<'+field+'>',seprator);
										}
									}
									//If it is Metafield then Check for Dropdown & Input fields
									else{
										$this = $("#" + field);
										//In Case of Dropdown the corresponding text should be updated & not the value
										if($this.attr('fieldtype')=="DROPDOWN"){
											if($this.find("option:selected").text() != undefined && $this.find("option:selected").text() != null && $this.find("option:selected").text() != "")
												pattern = pattern.replace('<'+$this.attr("id")+'>',$this.find("option:selected").text());
											else{
												pattern = replacePatternWithBlank(pattern,'<'+$this.attr("id")+'>',seprator);
											}
										}
										else{
											if($this.val() != undefined && $this.val() != null && $this.val() != "" && $this.val()!="AUTO GENERATED ON FIRST SAVE") 
												pattern = pattern.replace('<'+$this.attr("id")+'>',$this.val());
											else{
												pattern = replacePatternWithBlank(pattern,'<'+$this.attr("id")+'>',seprator);
											}
										}
									}
								});
								//Append Final Generated title to Contract Title Metafield
								$('#Contract_Title').val(pattern);
							}


							replacePatternWithBlank = function(str,field,seprator){
								var str = (str.indexOf(field) === 0) ? str.replace(field+seprator,'') : str.replace(seprator+field,'');
								return str;
							}

