								jQuery(".genericDetails .checkboxOptions").each(function(){
									var jsonObj = new Object();
									var $this = jQuery(this);

									jsonObj.fieldName = $this.find("input[type=checkbox]").attr('id');
									jsonObj.fieldType = $this.find("input[type=checkbox]").attr('fieldType');

									if( $this.find("input[type=checkbox]").is(':checked') ){
										jsonObj.fieldDataBaseValue = '1';
										jsonObj.fieldDisplayValue = '1';
									}else{
										jsonObj.fieldDataBaseValue = '0';
										jsonObj.fieldDisplayValue = '0';
									}
									jsonObj.fieldBehaviour = null;
									contractJsonArray.push(jsonObj);
								});

								jQuery(".genericDetails").find("select").not("#subEntityDiv select").each(function() {
									var jsonObj = new Object();
									var $this = jQuery(this);
									jsonObj.fieldName = $this.attr('id');
									jsonObj.fieldDisplayValue = jQuery("#" + this.id + " option:selected").text();

									if(this.id.toLowerCase() == "contract_owner") {
										jsonObj.fieldType = 'STRING';
										jsonObj.fieldDataBaseValue = jQuery("#" + this.id + " option:selected").text();
									} else {
										jsonObj.fieldType = $this.attr('fieldType');
										jsonObj.fieldDataBaseValue = $this.val();
									}

									var select = $(this).attr("data-shownonstandardvalue");
									if(select.trim().toUpperCase() === "TRUE"){
										jsonObj.fieldBehaviour = $(this).attr("data-behaviour");
									}else{
										jsonObj.fieldBehaviour = null;
									}

									contractJsonArray.push(jsonObj);
								});

								//Added by Nitin on 26th Nov 2017 for CLM 3103
								if($("#Same_as_Contract_Signed_Date").length != 0 && isLinkBetweenEffectiveDateAndSignedDate == "true"){
