									if($("#Same_as_Contract_Signed_Date :selected").text().toLowerCase() == "decide later" || $("#Same_as_Contract_Signed_Date :selected").text().toLowerCase() == "automatic (esignature date)"){

										if($("#Contract_Expiration_Date").val() != ""){
											expiryDate_3103 = $("#Contract_Expiration_Date").val();
										}		

										//replace date with new date
										 contractJsonArray.forEach(function(obj) { 
											 if(obj.fieldName == "Contract_Expiration_Date" || obj.fieldName == "Contract_Effective_Date" || obj.fieldName == "Contract_Renewal_Date" ){
												 if(obj.fieldName == "Contract_Expiration_Date"){

													 if($("#perpetualContractCheckBx").is(':checked')){
