													 return;
												 }

												 if(obj.fieldName == "Contract_Effective_Date"){
													 if($("#Same_as_Contract_Signed_Date").length != 0 && isRepo){
														 obj.fieldDataBaseValue=$("#Contract_Signed_On_date").val();
														 obj.fieldDisplayValue=$("#Contract_Signed_On_date").val();
													 }else{
														 obj.fieldDataBaseValue=effectiveDate_3103;
														 obj.fieldDisplayValue=effectiveDate_3103;
													 }
													 return;
												 }

												 //update renew date as per expiry date when isLinkBetweenEffectiveDateAndSignedDate flag is enable
												 if(obj.fieldName == "Contract_Renewal_Date" && jQuery("#AUTO_RENEW :selected").text().trim() == "Yes"){					
													 if($("#Contract_Renewal_Date").val().trim() == ""){
														var isExpiryValid = true; 
														var contractPeriodValue = $("#Contract_Term").val();
														if($("#Contract_Expiration_Date").val() == ""){
															if(contractPeriodValue.trim() != "" && !isNaN(contractPeriodValue.trim()) && $("#Contract_Term_Period_UoM :selected").text().trim() !=""){
																contractPeriodValue = parseFloat(contractPeriodValue);
																if(contractPeriodValue < 0 ){
																	isExpiryValid = false;
																}
															}else{
																isExpiryValid = false
															}
														}

														if(isExpiryValid){
															obj.fieldDataBaseValue=expiryDate_3103;
															obj.fieldDisplayValue=expiryDate_3103;
														}else{
															obj.fieldDataBaseValue=effectiveDate_3103;
															obj.fieldDisplayValue=effectiveDate_3103;
														}
													 }
													 renewDate_3103 = obj.fieldDisplayValue;
													 return;
												 }
											 }
										 });
									}
								}
								return contractJsonArray;
							}

