							changeISOtoUserTimeZoneForMeta = function(){
								var userOffsetInSettingsForMeta = getOffSetFromVarForMeta();
								userOffsetInSettingsForMeta = parseFloat((userOffsetInSettingsForMeta / (1000 * 60 * 60)).toFixed(2))

