							attachContractFile = function(elementId,fieldName,isNewDocument, iconClass){	
								var removeMessage='';	
								var specials=/[\\\/:"*?<>|]/;
								var url = contextName+'/AuthoringContract/uploadFile?'+"RESPONSE_TOKEN="+window.validationResponse;

								var uploader = new qq.FileUploader({
									element: document.getElementById(elementId),
									params: {attachmentlist : getFileSize()},
									encoding:'multipart',
									multiple:false,
									action: url,	
									sizeLimit: 41943040,
									template: '<div class="qq-uploader" style="display:inline;">' + 
											'<div class="qq-upload-drop-area"><span>{dragText}</span></div>' +
											'<div class="qq-upload-button icon '+ iconClass +' onlyIcon"></div>' +
											'<ul class="qq-upload-list" style="display:none;"></ul>' + 
										 '</div>',
									onSubmit : function(id, file){
									block("body");
									if(file.match(specials) != null && !(file.match(specials)))
										{
											iAlert(invalidFileName);
											unBlock("body");
											return false;		
										}
										if(file.length>255)
										{
											iAlert(MsgArry.contractauthoring_length_of_file_name);
											return false;	
										}
										var ext = file.substring(file.lastIndexOf(".")+1);
										if ((fieldName.toUpperCase()=='CONTRACT_SCAN_COPY') && !((ext && /^(doc|pdf|docx|txt)$/i.test(ext))))
										{	
											iAlert('Unsupported contract document format. Contract document can only be of type *.pdf ,*.docx ,*.txt or *.doc.');				
											unBlock("body");
											return false;
										} else if ( (ext && regExp.test(ext)))
										{
											iAlert(invalidFileExtension);
											return false;
										}

									},
									onComplete: function(id, file, response){
										unBlock("body");
										var str =new Array();
										var ext=file.substring(file.lastIndexOf(".")+1);
										if ((fieldName.toUpperCase()=='CONTRACT_SCAN_COPY') && !((ext && /^(doc|pdf|docx|txt)$/i.test(ext))))
										{	
											iAlert('Unsupported contract document format. Contract document can only be of type *.pdf ,*.docx ,*.txt or *.doc.');				
											unBlock("body");
											return false;
										} else if ( (ext && regExp.test(ext)))
										{
											iAlert(invalidFileExtension);
											return false;
										}
										if(typeof response == "String"){
											if(response.indexOf("portlet-msg-error") != -1)
											{
												iAlert(MsgArry.contractauthoring_common_file_size_exceed);
												return false;
											}
										}
										if(response.success == "1")
										{
											var size = response.fileSize;
											size = size/1048576;
											iAlert(MsgArry.contractauthoring_singleFileUploadLimit +" "+ size + ' MB.');
										}
										else if(response.success == "2")
										{
											var size = response.fileSize;
											size = size/1048576;
											iAlert(MsgArry.contractauthoring_totalFileUploadLimit +" "+ size + ' MB.');
										}
										else if(response.success == "true")
										{	
											if(isNewDocument=="true")
											{
												jQuery("#"+elementId+" .qq-upload-button").removeClass('upload');
												jQuery("#"+elementId+" .qq-upload-button").addClass('replace');
												jQuery('#'+fieldName).removeClass('uploadInputSet1');
												jQuery('#'+fieldName).addClass('edited');
												if(jQuery('#'+fieldName).hasClass('required'))
													jQuery('#'+fieldName).addClass('uploadInputSet2');
												else
													jQuery('#'+fieldName).addClass('uploadInputSet3');
												jQuery('#'+fieldName).val(jQuery.trim(file));
												jQuery('#'+fieldName).attr('value',jQuery.trim(file));
												jQuery('#'+fieldName).attr('name', jQuery.trim(response.fileId));
												jQuery('#'+fieldName+"_Download").attr('onclick','downloadContractFile("'+jQuery.trim(response.fileId)+'","'+jQuery.trim(file)+'","true")').show();
												jQuery('#'+fieldName+"_Delete").attr('onclick','deleteContractFile("'+fieldName+'")').show();
												changedData=true;
											}	
											jQuery("label[for='"+fieldName+"']").hide();	
										}
									}
								});
							}

