							//Added by Nimesh for CLM-7786, for converting number to String
							numberToWords = function(number, wordseprator) {

								var numberToString = number.toString(),
									units, tens, scales, start, end, chunks, chunksLen, chunk, ints, i, word, finalNumToString;

								var and = wordseprator || 'and';

								/* If number Zero then return */
								if (parseInt(numberToString) === 0) {
									return 'zero';
								}

								/* units as finalNumToString */
								units = ['', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight', 'nine', 'ten', 'eleven', 'twelve', 'thirteen', 'fourteen', 'fifteen', 'sixteen', 'seventeen', 'eighteen', 'nineteen'];

								/* tens as finalNumToString */
								tens = ['', '', 'twenty', 'thirty', 'forty', 'fifty', 'sixty', 'seventy', 'eighty', 'ninety'];

								/* thousands as finalNumToString */
								scales = ['', 'thousand', 'million', 'billion', 'trillion', 'quadrillion', 'quintillion', 'sextillion', 'septillion', 'octillion', 'nonillion', 'decillion', 'undecillion', 'duodecillion', 'tredecillion', 'quatttuor-decillion', 'quindecillion', 'sexdecillion', 'septen-decillion', 'octodecillion', 'novemdecillion', 'vigintillion', 'centillion'];

								/* Split user arguemnt into 3 digit chunks from right to left */
								start = numberToString.length;
								chunks = [];
								while (start > 0) {
									end = start;
									chunks.push(numberToString.slice((start = Math.max(0, start - 3)), end));
								}

								/* Check if function has enough scale finalNumToString to be able to stringify the user argument */
								chunksLen = chunks.length;
								if (chunksLen > scales.length) {
									return '';
								}

								/* Stringify each integer in each chunk */
								finalNumToString = [];
								for (i = 0; i < chunksLen; i++) {

									chunk = parseInt(chunks[i]);

									if (chunk) {

										/* Split chunk into array of individual integers */
										ints = chunks[i].split('').reverse().map(parseFloat);

										/* If tens integer is 1, i.e. 10, then add 10 to units integer */
										if (ints[1] === 1) {
											ints[0] += 10;
										}

										/* Match for scale word and insert if chunk is not zero */
										if ((word = scales[i])) {
											finalNumToString.push(word);
										}

										/* finalNumToString insertion for unit place */
										if ((word = units[ints[0]])) {
											finalNumToString.push(word);
										}

										/* finalNumToString insertion for ten's place */
										if ((word = tens[ints[1]])) {
											finalNumToString.push(word);
										}

										/* Add 'and' numberToString after units or tens integer if: */
										if (ints[0] || ints[1]) {

											/* Chunk has a hundreds integer or chunk is the first of multiple chunks
											if (ints[2]) {
												finalNumToString.push(and);
											} */

										}

										/* Add hundreds word if array item exists */
										if ((word = units[ints[2]])) {
											finalNumToString.push(word + ' hundred');
										}

									}

								}

								return finalNumToString.reverse().join(' ');

							}

							//Added by Nimesh for CLM-7786, for converting number to String
							numberToWordsWithDecimal = function(numberWithDecimal,seprator) {
								var deimalSeprator = 'point' || seprator;
								var number = numberWithDecimal.toString().split('.')
								var whole = numberToWords(number[0])
								//Check if Number is Whole or Decimal
								if (number.length == 2) {
									var fraction = numberToWords(number[1])
									return whole +" "+deimalSeprator+" "+ fraction;
								} else {
									return whole;
								}
							}


