							terminate_convertDateToUserFormat = function(dateToConvert){
								if(dateToConvert!=null || dateToConvert!="" || dateToConvert!=undefined){
									var d = new Date(dateToConvert);
								}	
								  var month = d.getMonth()+1;
								  var day = d.getDate();
								  var output;
									switch(userDateFormatWithoutChange.toUpperCase()){
									case "DD/MM/YYYY": 
										 output = (day<10 ? '0' : '') + day + '/' + (month<10 ? '0' : '') + month + '/' + d.getFullYear();
										break;
									case "MM/DD/YYYY":
										 output =  (month<10 ? '0' : '') + month + '/' + (day<10 ? '0' : '') + day+ '/' + d.getFullYear();
										break;
									case "YYYY/MM/DD":
										 output = d.getFullYear() + '/' + (month<10 ? '0' : '') + month + '/' + (day<10 ? '0' : '') + day;
										break;
								}
								return output;	
							}

