							calculateExpiryDateAccordingToTerm = function(dateText){
								//Modified by Richa on 23rd November 2017
								contractTermPeriod = $("#Contract_Term_Period_UoM :selected").text();
								var contractPeriodValue = $("#Contract_Term").val(); 
								$("#Contract_Term_error").remove();

								if(isNaN(contractPeriodValue.trim())){
									$("#Contract_Term").parent().append("<label id='Contract_Term_error' class='error'>"+flexi_fmt_icontract_contractterm_whole_number_error+"</label>")
									return;
								}
								if(contractPeriodValue.trim() < 0 ){
									$("#Contract_Term").parent().append("<label id='Contract_Term_error' class='error'>"+flexi_fmt_icontract_contractterm_negative_number_error+"</label>")
									return;
								}
								if(dateText != "" && contractPeriodValue.trim() != "" && !isNaN(contractPeriodValue.trim()) && contractTermPeriod.trim() !="" ){
									/* Flexi Code */
									var startDate = getJavaScriptDate(dateText,flexi_userDateFormat);
									if(contractPeriodValue!=0){
										var endDate = calculateExpiryDate(startDate, contractPeriodValue , contractTermPeriod);
										jQuery("#Contract_Expiration_Date").val($.datepicker.formatDate(dateformat, endDate)).trigger("change");
										expiryDate_3103 = jQuery("#Contract_Expiration_Date").val();
									}
									jQuery("#Contract_Expiration_Date").addClass("edited");
									$("#Contract_Term_warning").remove();

									if($("#Same_as_Contract_Signed_Date").length != 0 && isRepo && jQuery("#AUTO_RENEW :selected").text().trim() == "Yes")
										//Modified for CLM-6934
										$("#Contract_Renewal_Date").val(expiryDate_3103).trigger("click").trigger("change");
									if($("#perpetualContractCheckBx").is(':checked')){
										//Modified for CLM-6934
										jQuery("#Contract_Expiration_Date").val("").trigger("click").trigger("change");
									}
								}
							}

							// added for expiry date changes
							calculateExpiryDate = function(startDate, contractPeriodValue, contractTermPeriod) {
								$(".error").remove();
								momentObj = moment(new Date(startDate.getFullYear() , startDate.getMonth() , startDate.getDate()));

								switch(contractTermPeriod){
								case "Months" : momentObj.add(contractPeriodValue, 'months');
												break;
								case  "Days"  : momentObj.add(contractPeriodValue, 'days');
												break;
								case  "Years"  : momentObj.add(contractPeriodValue, 'years');
												break;
								case  "Weeks"  : momentObj.add(contractPeriodValue, 'weeks');
												break;
								case "Quarters": momentObj.add(contractPeriodValue, 'quarters');
												break;
								default 	  : customExpiryDateCalculation(startDate, contractPeriodValue, customTimePeriod , contractTermPeriod);
												//customExpiryDateCalculation(startDate, number input of user, array of custom elements , user input of dropdown);
												break;
								}

								/* Modified by Richa on 30th November 2017 */
									momentObj.subtract(1, 'days');
									return momentObj._d;


							};

							/* Added by Richa on 24th November 2017 */
							customExpiryDateCalculation = function(startDate, contractPeriodValue, customTimePeriod , contractTermPeriod){
								contractTermPeriod = $("#Contract_Term_Period_UoM :selected").text();
								for(var i =0;i<customTimePeriod.length;i++){
									if(customTimePeriod[i].uomKey.toLowerCase() == contractTermPeriod.toLowerCase()){
										if(customTimePeriod[i].periodDecisionParam == "ADDITION"){
											momentObj.add(contractPeriodValue*customTimePeriod[i].timePeriod, 'days');
										}else if(customTimePeriod[i].periodDecisionParam == "SUBTRACTION"){
											momentObj.subtract(contractPeriodValue*customTimePeriod[i].timePeriod, 'days');
										}
									}
								}
								var endDate = momentObj._d;
								return endDate;
							}

